import React, { Component } from 'react';

import Header from './Header'
import MemberList from './MemberList'
import CrewList from './CrewList'

function App() {

	return(
		<div>
			<Header />
			<div className="content-wrapper">
				<MemberList />
				<CrewList />
			</div>
		</div>
	)
}

export default App;
